                    'Baitfish': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Nymph' && fly.fly_imitation === 'Baitfish'
                },
                'Emerger': {
                    '': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Emerger',
                    'Mayfly': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Emerger' && fly.fly_imitation === 'Mayfly',
                    'Caddis': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Emerger' && fly.fly_imitation === 'Caddis',
                    'Stonefly': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Emerger' && fly.fly_imitation === 'Stonefly',
                    'Midge': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Emerger' && fly.fly_imitation === 'Midge',
                    'Terrestrials': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Emerger' && fly.fly_imitation === 'Terrestrial',
                    'Baitfish': fly => fly.fly_type === 'Dry' && fly.fly_life_cycle === 'Emerger' && fly.fly_imitation === 'Baitfish'
                },
